l\":\"\/timedtext_video?ref=watch\\u0026v=AarLx_b1lQs\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"AarLx_b1lQs\",\"title\":\"Barracuda Attacks Brady- Sailing SV Delos Ep. 85\",\"lengthSeconds\":\"1477\",\"keywords\":[\"sailing\",\"sailing (sport)\",\"sailing around the world\",\"إبحار\",\"cruising\",\"yacht\",\"sailboat\",\"sailboat (ship type)\",\"sailor\",\"life on a yacht\",\"Travel Documentary\",\"Travel\",\"Adventure Documentary\",\"adventure\",\"Rough Seas\",\"circumnavigate\",\"ketch\",\"sail\",\"boat\",\"blue water cruising\",\"sailing for beginners\",\"single-handed sailing (film subject)\",\"storm\",\"islands\",\"marine\",\"fishing\",\"sv delos\",\"Amel Super Maramu\",\"Seven Seas\",\"diving\",\"remote diving\",\"underwater photography\",\"delos\",\"ocean\",\"navegación\",\"cocos keeling\"],\"channelId\":\"UCvLc83k5o11EIF1lEo0VmuQ\",\"isOwnerViewing\":false,\"shortDescription\":\"Only one sailor was slightly harmed in the making of this episode.....  The crew is ready to leave Cocos Keeling and set sail for Chagos!  We say our goodbye's and stock Delos with provisions and fuel for the next 2 months.  After a last incredible dive in Cocos Keeling Brady washes his hands off the back of Delos and WHAM!  He gets an unpleasant surprise.....\\n\\nSubscribe at http:\/\/youtube.com\/svdelos\\n\\nCheck the links below for more SV Delos Sailing Around The World Action!\\n\\nwww.svdelos.com\\nwww.instagram.com\/svdelos\\nwww.facebook.com\/svdelos\\n\\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\\n\\nCheck the links below for more SV Delos Sailing Around The World Action!\\n\\nwww.svdelos.com\\nwww.instagram.com\/svdelos\\nwww.facebook.com\/svdelos\\n\\nOur Mission\\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\\n\\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\\n\\nSend Us Love\\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \\n\\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \\n\\nSupport Our Videos- Buy us a cold one.\\nhttp:\/\/www.svdelos.com\/buy-us-a-beer\\n\\nMusic Used In this Video:\\nHidden Blues  - Pitx- Dig.ccmixter.org\\nKicked Up Pumps- Audionautix Audionautix.com\\nPop Star - Audionautix Audionautix.com\\nBlack Vortex - Kevin MacLeod \\nClouds - Audionautix Audionautix.com\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/AarLx_b1lQs\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCcvFK-RJAndntpvOuVETatpmw2AA\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/AarLx_b1lQs\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLB2UE-DAgsgAVVPEm4wPfSEad8kRw\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/AarLx_b1lQs\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qp eeling and set sail for Chagos!  We say our goodbye's and stock Delos with provisions and fuel for the next 2 months.  After a last incredible dive in Cocos Keeling Brady washes his hands off the back of Delos and WHAM!  He gets an unpleasant surprise.....\n\nSubscribe at "},{"text":"http://youtube.com/svdelos","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIyKacpOKY6gIVw9cWCh1ZTAy3SIuq1rf_-LLVAQ==","commandMetadata":{"webCommandMetadata":{"url":"http://youtube.com/svdelos","rootVe":83769}},"urlEndpoint":{"url":"http://youtube.com/svdelos","nofollow":true}}},{"text":"\n\nCheck the links below for more SV Delos Sailing Around The World Action!\n\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\n\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\n\nCheck the links below for more SV Delos Sailing Around The World Action!\n\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\n\nOur Mission\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\n\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \n\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \n\nSupport Our Videos- Buy us a cold one.\n"},{"text":"http://www.svdelos.com/buy-us-a-beer","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIyKacpOKY6gIVw9cWCh1ZTAy3SIuq1rf_-LLVAQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=3C_5HawEhDFJ2CestBN78nu4WDx8MTU5MzAzMDI1M0AxNTkyOTQzODUz\u0026q=http%3A%2F%2Fwww.svdelos.com%2Fbuy-us-a-beer\u0026event=video_description\u0026v=AarLx_b1lQs","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=3C_5HawEhDFJ2CestBN78nu4WDx8MTU5MzAzMDI1M0AxNTkyOTQzODUz\u0026q=http%3A%2F%2Fwww.svdelos.com%2Fbuy-us-a-beer\u0026event=video_description\u0026v=AarLx_b1lQs","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nMusic Used In this Video:\nHidden Blues  - Pitx- Dig.ccmixter.org\nKicked Up Pumps- Audionautix Audionautix.com\nPop Star - Audionautix Audionautix.com\nBlack Vortex - Kevin MacLeod \nClouds - Audionautix Audionautix.com"}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJMBEJsrIhMIyKacpOKY6gIVw9cWCh1ZTAy3","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJQBEP2GBCITCMimnKTimOoCFcPXFgodWUwMtzIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddes 83769}},"urlEndpoint":{"url":"/timedtext_video?ref=watch\u0026v=AarLx_b1lQs"}}}]},"noSubtitlesText":{"simpleText":"This video doesn't have subtitles or closed captions yet."},"promoSubtitlesText":{"simpleText":"Help this video reach more people by contributing subtitles or closed captions in a language you speak."}}}}},"videoDetails":{"videoId":"AarLx_b1lQs","title":"Barracuda Attacks Brady- Sailing SV Delos Ep. 85","lengthSeconds":"1477","keywords":["sailing","sailing (sport)","sailing around the world","إبحار","cruising","yacht","sailboat","sailboat (ship type)","sailor","life on a yacht","Travel Documentary","Travel","Adventure Documentary","adventure","Rough Seas","circumnavigate","ketch","sail","boat","blue water cruising","sailing for beginners","single-handed sailing (film subject)","storm","islands","marine","fishing","sv delos","Amel Super Maramu","Seven Seas","diving","remote diving","underwater photography","delos","ocean","navegación","cocos keeling"],"channelId":"UCvLc83k5o11EIF1lEo0VmuQ","isOwnerViewing":false,"shortDescription":"Only one sailor was slightly harmed in the making of this episode.....  The crew is ready to leave Cocos Keeling and set sail for Chagos!  We say our goodbye's and stock Delos with provisions and fuel for the next 2 months.  After a last incredible dive in Cocos Keeling Brady washes his hands off the back of Delos and WHAM!  He gets an unpleasant surprise.....\n\nSubscribe at http://youtube.com/svdelos\n\nCheck the links below for more SV Delos Sailing Around The World Action!\n\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\n\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\n\nCheck the links below for more SV Delos Sailing Around The World Action!\n\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\n\nOur Mission\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\n\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \n\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \n\nSupport Our Videos- Buy us a cold one.\nhttp://www.svdelos.com/buy-us-a-beer\n\nMusic Used In this Video:\nHidden Blues  - Pitx- Dig.ccmixter.org\nKicked Up Pumps- Audionautix Audionautix.com\nPop Star - Audionautix Audionautix.com\nBlack Vortex - Kevin MacLeod \nClouds - Audionautix Audionautix.com","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/AarLx_b1lQs/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCcvFK-RJAndntpvOuVETatpmw2AA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/AarLx_b1lQs/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB2UE-DAgsgAVVPEm4wPfSEad8kRw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/AarLx_b1lQs/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCtGLxlhqjlKS5oOxBMhFyuRveNSQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/AarLx_b1lQs/hqdefault.jpg?sqp=-oaymwEjCNACE spiration to follow their dreams and do what they love.\n\nCheck the links below for more SV Delos Sailing Around The World Action!\n\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\n\nOur Mission\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\n\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \n\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \n\nSupport Our Videos- Buy us a cold one.\nhttp://www.svdelos.com/buy-us-a-beer\n\nMusic Used In this Video:\nHidden Blues  - Pitx- Dig.ccmixter.org\nKicked Up Pumps- Audionautix Audionautix.com\nPop Star - Audionautix Audionautix.com\nBlack Vortex - Kevin MacLeod \nClouds - Audionautix Audionautix.com"},"lengthSeconds":"1477","ownerProfileUrl":"http://www.youtube.com/user/briantrautman","externalChannelId":"UCvLc83k5o11EIF1lEo0VmuQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","J
